import { ComfyLogging } from "./logging.js";
import { ComfyWidgets } from "./widgets.js";
import { ComfyUI, $el } from "./ui.js";
import { api } from "./api.js";
import { defaultGraph } from "./defaultGraph.js";
import {
  getPngMetadata,
  getWebpMetadata,
  importA1111,
  getLatentMetadata,
} from "./pnginfo.js";
import { addDomClippingSetting } from "./domWidget.js";
import { createImageHost, calculateImageGrid } from "./ui/imagePreview.js";
import nodesDefs from "./nodesDefs.json";
import { LiteGraph, LGraphCanvas, LGraph } from "litegraph.js";

export const ANIM_PREVIEW_WIDGET = "$$comfy_animation_preview";

function sanitizeNodeName(string) {
  let entityMap = {
    "&": "",
    "<": "",
    ">": "",
    '"': "",
    "'": "",
    "`": "",
    "=": "",
  };
  return String(string).replace(/[&<>"'`=]/g, function fromEntityMap(s) {
    return entityMap[s];
  });
}

/**
 * @typedef {import("types/comfy").ComfyExtension} ComfyExtension
 */

export class ComfyApp {
  /**
   * List of entries to queue
   * @type {{number: number, batchCount: number}[]}
   */
  #queueItems = [];
  /**
   * If the queue is currently being processed
   * @type {boolean}
   */
  #processingQueue = false;

  /**
   * Content Clipboard
   * @type {serialized node object}
   */
  static clipspace = null;
  static clipspace_invalidate_handler = null;
  static open_maskeditor = null;
  static clipspace_return_node = null;

  constructor() {
    this.ui = new ComfyUI(this);
    this.logging = new ComfyLogging(this);

    /**
     * List of extensions that are registered with the app
     * @type {ComfyExtension[]}
     */
    this.extensions = [];

    /**
     * Stores the execution output data for each node
     * @type {Record<string, any>}
     */
    this.nodeOutputs = {};

    /**
     * Stores the preview image data for each node
     * @type {Record<string, Image>}
     */
    this.nodePreviewImages = {};

    /**
     * If the shift key on the keyboard is pressed
     * @type {boolean}
     */
    this.shiftDown = false;
  }

  getPreviewFormatParam() {
    let preview_format = this.ui.settings.getSettingValue(
      "Comfy.PreviewFormat"
    );
    if (preview_format) return `&preview=${preview_format}`;
    else return "";
  }

  static isImageNode(node) {
    return (
      node.imgs ||
      (node &&
        node.widgets &&
        node.widgets.findIndex((obj) => obj.name === "image") >= 0)
    );
  }

  static onClipspaceEditorSave() {
    if (ComfyApp.clipspace_return_node) {
      ComfyApp.pasteFromClipspace(ComfyApp.clipspace_return_node);
    }
  }

  static onClipspaceEditorClosed() {
    ComfyApp.clipspace_return_node = null;
  }

  static copyToClipspace(node) {
    var widgets = null;
    if (node.widgets) {
      widgets = node.widgets.map(({ type, name, value }) => ({
        type,
        name,
        value,
      }));
    }

    var imgs = undefined;
    var orig_imgs = undefined;
    if (node.imgs != undefined) {
      imgs = [];
      orig_imgs = [];

      for (let i = 0; i < node.imgs.length; i++) {
        imgs[i] = new Image();
        imgs[i].src = node.imgs[i].src;
        orig_imgs[i] = imgs[i];
      }
    }

    var selectedIndex = 0;
    if (node.imageIndex) {
      selectedIndex = node.imageIndex;
    }

    ComfyApp.clipspace = {
      widgets: widgets,
      imgs: imgs,
      original_imgs: orig_imgs,
      images: node.images,
      selectedIndex: selectedIndex,
      img_paste_mode: "selected", // reset to default im_paste_mode state on copy action
    };

    ComfyApp.clipspace_return_node = null;

    if (ComfyApp.clipspace_invalidate_handler) {
      ComfyApp.clipspace_invalidate_handler();
    }
  }

  static pasteFromClipspace(node) {
    if (ComfyApp.clipspace) {
      // image paste
      if (ComfyApp.clipspace.imgs && node.imgs) {
        if (node.images && ComfyApp.clipspace.images) {
          if (ComfyApp.clipspace["img_paste_mode"] == "selected") {
            node.images = [
              ComfyApp.clipspace.images[ComfyApp.clipspace["selectedIndex"]],
            ];
          } else {
            node.images = ComfyApp.clipspace.images;
          }

          if (app.nodeOutputs[node.id + ""])
            app.nodeOutputs[node.id + ""].images = node.images;
        }

        if (ComfyApp.clipspace.imgs) {
          // deep-copy to cut link with clipspace
          if (ComfyApp.clipspace["img_paste_mode"] == "selected") {
            const img = new Image();
            img.src =
              ComfyApp.clipspace.imgs[ComfyApp.clipspace["selectedIndex"]].src;
            node.imgs = [img];
            node.imageIndex = 0;
          } else {
            const imgs = [];
            for (let i = 0; i < ComfyApp.clipspace.imgs.length; i++) {
              imgs[i] = new Image();
              imgs[i].src = ComfyApp.clipspace.imgs[i].src;
              node.imgs = imgs;
            }
          }
        }
      }

      if (node.widgets) {
        if (ComfyApp.clipspace.images) {
          const clip_image =
            ComfyApp.clipspace.images[ComfyApp.clipspace["selectedIndex"]];
          const index = node.widgets.findIndex((obj) => obj.name === "image");
          if (index >= 0) {
            if (
              node.widgets[index].type != "image" &&
              typeof node.widgets[index].value == "string" &&
              clip_image.filename
            ) {
              node.widgets[index].value =
                (clip_image.subfolder ? clip_image.subfolder + "/" : "") +
                clip_image.filename +
                (clip_image.type ? ` [${clip_image.type}]` : "");
            } else {
              node.widgets[index].value = clip_image;
            }
          }
        }
        if (ComfyApp.clipspace.widgets) {
          ComfyApp.clipspace.widgets.forEach(({ type, name, value }) => {
            const prop = Object.values(node.widgets).find(
              (obj) => obj.type === type && obj.name === name
            );
            if (prop && prop.type != "button") {
              if (
                prop.type != "image" &&
                typeof prop.value == "string" &&
                value.filename
              ) {
                prop.value =
                  (value.subfolder ? value.subfolder + "/" : "") +
                  value.filename +
                  (value.type ? ` [${value.type}]` : "");
              } else {
                prop.value = value;
                prop.callback(value);
              }
            }
          });
        }
      }

      app.graph.setDirtyCanvas(true);
    }
  }

  /**
   * Invoke an extension callback
   * @param {keyof ComfyExtension} method The extension callback to execute
   * @param  {any[]} args Any arguments to pass to the callback
   * @returns
   */
  #invokeExtensions(method, ...args) {
    let results = [];
    for (const ext of this.extensions) {
      if (method in ext) {
        try {
          results.push(ext[method](...args, this));
        } catch (error) {
          console.error(
            `Error calling extension '${ext.name}' method '${method}'`,
            { error },
            { extension: ext },
            { args }
          );
        }
      }
    }
    return results;
  }

  /**
   * Invoke an async extension callback
   * Each callback will be invoked concurrently
   * @param {string} method The extension callback to execute
   * @param  {...any} args Any arguments to pass to the callback
   * @returns
   */
  async #invokeExtensionsAsync(method, ...args) {
    return await Promise.all(
      this.extensions.map(async (ext) => {
        if (method in ext) {
          try {
            return await ext[method](...args, this);
          } catch (error) {
            console.error(
              `Error calling extension '${ext.name}' method '${method}'`,
              { error },
              { extension: ext },
              { args }
            );
          }
        }
      })
    );
  }

  /**
   * Adds special context menu handling for nodes
   * e.g. this adds Open Image functionality for nodes that show images
   * @param {*} node The node to add the menu handler
   */
  #addNodeContextMenuHandler(node) {
    node.prototype.getExtraMenuOptions = function (_, options) {
      if (this.imgs) {
        // If this node has images then we add an open in new tab item
        let img;
        if (this.imageIndex != null) {
          // An image is selected so select that
          img = this.imgs[this.imageIndex];
        } else if (this.overIndex != null) {
          // No image is selected but one is hovered
          img = this.imgs[this.overIndex];
        }
        if (img) {
          options.unshift(
            {
              content: "Open Image",
              callback: () => {
                let url = new URL(img.src);
                url.searchParams.delete("preview");
                window.open(url, "_blank");
              },
            },
            {
              content: "Save Image",
              callback: () => {
                const a = document.createElement("a");
                let url = new URL(img.src);
                url.searchParams.delete("preview");
                a.href = url;
                a.setAttribute(
                  "download",
                  new URLSearchParams(url.search).get("filename")
                );
                document.body.append(a);
                a.click();
                requestAnimationFrame(() => a.remove());
              },
            }
          );
        }
      }

      options.push({
        content: "Bypass",
        callback: (obj) => {
          if (this.mode === 4) this.mode = 0;
          else this.mode = 4;
          this.graph.change();
        },
      });

      // prevent conflict of clipspace content
      if (!ComfyApp.clipspace_return_node) {
        options.push({
          content: "Copy (Clipspace)",
          callback: (obj) => {
            ComfyApp.copyToClipspace(this);
          },
        });

        if (ComfyApp.clipspace != null) {
          options.push({
            content: "Paste (Clipspace)",
            callback: () => {
              ComfyApp.pasteFromClipspace(this);
            },
          });
        }

        if (ComfyApp.isImageNode(this)) {
          options.push({
            content: "Open in MaskEditor",
            callback: (obj) => {
              ComfyApp.copyToClipspace(this);
              ComfyApp.clipspace_return_node = this;
              ComfyApp.open_maskeditor();
            },
          });
        }
      }
    };
  }

  #addNodeKeyHandler(node) {
    const app = this;
    const origNodeOnKeyDown = node.prototype.onKeyDown;

    node.prototype.onKeyDown = function (e) {
      if (origNodeOnKeyDown && origNodeOnKeyDown.apply(this, e) === false) {
        return false;
      }

      if (this.flags.collapsed || !this.imgs || this.imageIndex === null) {
        return;
      }

      let handled = false;

      if (e.key === "ArrowLeft" || e.key === "ArrowRight") {
        if (e.key === "ArrowLeft") {
          this.imageIndex -= 1;
        } else if (e.key === "ArrowRight") {
          this.imageIndex += 1;
        }
        this.imageIndex %= this.imgs.length;

        if (this.imageIndex < 0) {
          this.imageIndex = this.imgs.length + this.imageIndex;
        }
        handled = true;
      } else if (e.key === "Escape") {
        this.imageIndex = null;
        handled = true;
      }

      if (handled === true) {
        e.preventDefault();
        e.stopImmediatePropagation();
        return false;
      }
    };
  }

  /**
   * Adds Custom drawing logic for nodes
   * e.g. Draws images and handles thumbnail navigation on nodes that output images
   * @param {*} node The node to add the draw handler
   */
  #addDrawBackgroundHandler(node) {
    const app = this;

    function getImageTop(node) {
      let shiftY;
      if (node.imageOffset != null) {
        shiftY = node.imageOffset;
      } else {
        if (node.widgets?.length) {
          const w = node.widgets[node.widgets.length - 1];
          shiftY = w.last_y;
          if (w.computeSize) {
            shiftY += w.computeSize()[1] + 4;
          } else if (w.computedHeight) {
            shiftY += w.computedHeight;
          } else {
            shiftY += LiteGraph.NODE_WIDGET_HEIGHT + 4;
          }
        } else {
          shiftY = node.computeSize()[1];
        }
      }
      return shiftY;
    }

    node.prototype.setSizeForImage = function (force) {
      if (!force && this.animatedImages) return;

      if (this.inputHeight) {
        this.setSize(this.size);
        return;
      }
      const minHeight = getImageTop(this) + 220;
      if (this.size[1] < minHeight) {
        this.setSize([this.size[0], minHeight]);
      }
    };

    node.prototype.onDrawBackground = function (ctx) {
      if (!this.flags.collapsed) {
        let imgURLs = [];
        let imagesChanged = false;

        const output = app.nodeOutputs[this.id + ""];
        if (output?.images) {
          this.animatedImages = output?.animated?.find(Boolean);
          if (this.images !== output.images) {
            this.images = output.images;
            imagesChanged = true;
            imgURLs = imgURLs.concat(
              output.images.map((params) => {
                return api.apiURL(
                  "/view?" +
                    new URLSearchParams(params).toString() +
                    (this.animatedImages ? "" : app.getPreviewFormatParam())
                );
              })
            );
          }
        }

        const preview = app.nodePreviewImages[this.id + ""];
        if (this.preview !== preview) {
          this.preview = preview;
          imagesChanged = true;
          if (preview != null) {
            imgURLs.push(preview);
          }
        }

        if (imagesChanged) {
          this.imageIndex = null;
          if (imgURLs.length > 0) {
            Promise.all(
              imgURLs.map((src) => {
                return new Promise((r) => {
                  const img = new Image();
                  img.onload = () => r(img);
                  img.onerror = () => r(null);
                  img.src = src;
                });
              })
            ).then((imgs) => {
              if (
                (!output || this.images === output.images) &&
                (!preview || this.preview === preview)
              ) {
                this.imgs = imgs.filter(Boolean);
                this.setSizeForImage?.();
                app.graph.setDirtyCanvas(true);
              }
            });
          } else {
            this.imgs = null;
          }
        }

        function calculateGrid(w, h, n) {
          let columns, rows, cellsize;

          if (w > h) {
            cellsize = h;
            columns = Math.ceil(w / cellsize);
            rows = Math.ceil(n / columns);
          } else {
            cellsize = w;
            rows = Math.ceil(h / cellsize);
            columns = Math.ceil(n / rows);
          }

          while (columns * rows < n) {
            cellsize++;
            if (w >= h) {
              columns = Math.ceil(w / cellsize);
              rows = Math.ceil(n / columns);
            } else {
              rows = Math.ceil(h / cellsize);
              columns = Math.ceil(n / rows);
            }
          }

          const cell_size = Math.min(w / columns, h / rows);
          return { cell_size, columns, rows };
        }

        function is_all_same_aspect_ratio(imgs) {
          // assume: imgs.length >= 2
          let ratio = imgs[0].naturalWidth / imgs[0].naturalHeight;

          for (let i = 1; i < imgs.length; i++) {
            let this_ratio = imgs[i].naturalWidth / imgs[i].naturalHeight;
            if (ratio != this_ratio) return false;
          }

          return true;
        }

        if (this.imgs?.length) {
          const widgetIdx = this.widgets?.findIndex(
            (w) => w.name === ANIM_PREVIEW_WIDGET
          );

          if (this.animatedImages) {
            // Instead of using the canvas we'll use a IMG
            if (widgetIdx > -1) {
              // Replace content
              const widget = this.widgets[widgetIdx];
              widget.options.host.updateImages(this.imgs);
            } else {
              const host = createImageHost(this);
              this.setSizeForImage(true);
              const widget = this.addDOMWidget(
                ANIM_PREVIEW_WIDGET,
                "img",
                host.el,
                {
                  host,
                  getHeight: host.getHeight,
                  onDraw: host.onDraw,
                  hideOnZoom: false,
                }
              );
              widget.serializeValue = () => undefined;
              widget.options.host.updateImages(this.imgs);
            }
            return;
          }

          if (widgetIdx > -1) {
            this.widgets[widgetIdx].onRemove?.();
            this.widgets.splice(widgetIdx, 1);
          }

          const canvas = app.graph.list_of_graphcanvas[0];
          const mouse = canvas.graph_mouse;
          if (!canvas.pointer_is_down && this.pointerDown) {
            if (
              mouse[0] === this.pointerDown.pos[0] &&
              mouse[1] === this.pointerDown.pos[1]
            ) {
              this.imageIndex = this.pointerDown.index;
            }
            this.pointerDown = null;
          }

          let imageIndex = this.imageIndex;
          const numImages = this.imgs.length;
          if (numImages === 1 && !imageIndex) {
            this.imageIndex = imageIndex = 0;
          }

          const top = getImageTop(this);
          var shiftY = top;

          let dw = this.size[0];
          let dh = this.size[1];
          dh -= shiftY;

          if (imageIndex == null) {
            var cellWidth, cellHeight, shiftX, cell_padding, cols;

            const compact_mode = is_all_same_aspect_ratio(this.imgs);
            if (!compact_mode) {
              // use rectangle cell style and border line
              cell_padding = 2;
              const { cell_size, columns, rows } = calculateGrid(
                dw,
                dh,
                numImages
              );
              cols = columns;

              cellWidth = cell_size;
              cellHeight = cell_size;
              shiftX = (dw - cell_size * cols) / 2;
              shiftY = (dh - cell_size * rows) / 2 + top;
            } else {
              cell_padding = 0;
              ({ cellWidth, cellHeight, cols, shiftX } = calculateImageGrid(
                this.imgs,
                dw,
                dh
              ));
            }

            let anyHovered = false;
            this.imageRects = [];
            for (let i = 0; i < numImages; i++) {
              const img = this.imgs[i];
              const row = Math.floor(i / cols);
              const col = i % cols;
              const x = col * cellWidth + shiftX;
              const y = row * cellHeight + shiftY;
              if (!anyHovered) {
                anyHovered = LiteGraph.isInsideRectangle(
                  mouse[0],
                  mouse[1],
                  x + this.pos[0],
                  y + this.pos[1],
                  cellWidth,
                  cellHeight
                );
                if (anyHovered) {
                  this.overIndex = i;
                  let value = 110;
                  if (canvas.pointer_is_down) {
                    if (!this.pointerDown || this.pointerDown.index !== i) {
                      this.pointerDown = { index: i, pos: [...mouse] };
                    }
                    value = 125;
                  }
                  ctx.filter = `contrast(${value}%) brightness(${value}%)`;
                  canvas.canvas.style.cursor = "pointer";
                }
              }
              this.imageRects.push([x, y, cellWidth, cellHeight]);

              let wratio = cellWidth / img.width;
              let hratio = cellHeight / img.height;
              var ratio = Math.min(wratio, hratio);

              let imgHeight = ratio * img.height;
              let imgY =
                row * cellHeight + shiftY + (cellHeight - imgHeight) / 2;
              let imgWidth = ratio * img.width;
              let imgX = col * cellWidth + shiftX + (cellWidth - imgWidth) / 2;

              ctx.drawImage(
                img,
                imgX + cell_padding,
                imgY + cell_padding,
                imgWidth - cell_padding * 2,
                imgHeight - cell_padding * 2
              );
              if (!compact_mode) {
                // rectangle cell and border line style
                ctx.strokeStyle = "#8F8F8F";
                ctx.lineWidth = 1;
                ctx.strokeRect(
                  x + cell_padding,
                  y + cell_padding,
                  cellWidth - cell_padding * 2,
                  cellHeight - cell_padding * 2
                );
              }

              ctx.filter = "none";
            }

            if (!anyHovered) {
              this.pointerDown = null;
              this.overIndex = null;
            }
          } else {
            // Draw individual
            let w = this.imgs[imageIndex].naturalWidth;
            let h = this.imgs[imageIndex].naturalHeight;

            const scaleX = dw / w;
            const scaleY = dh / h;
            const scale = Math.min(scaleX, scaleY, 1);

            w *= scale;
            h *= scale;

            let x = (dw - w) / 2;
            let y = (dh - h) / 2 + shiftY;
            ctx.drawImage(this.imgs[imageIndex], x, y, w, h);

            const drawButton = (x, y, sz, text) => {
              const hovered = LiteGraph.isInsideRectangle(
                mouse[0],
                mouse[1],
                x + this.pos[0],
                y + this.pos[1],
                sz,
                sz
              );
              let fill = "#333";
              let textFill = "#fff";
              let isClicking = false;
              if (hovered) {
                canvas.canvas.style.cursor = "pointer";
                if (canvas.pointer_is_down) {
                  fill = "#1e90ff";
                  isClicking = true;
                } else {
                  fill = "#eee";
                  textFill = "#000";
                }
              } else {
                this.pointerWasDown = null;
              }

              ctx.fillStyle = fill;
              ctx.beginPath();
              ctx.roundRect(x, y, sz, sz, [4]);
              ctx.fill();
              ctx.fillStyle = textFill;
              ctx.font = "12px Arial";
              ctx.textAlign = "center";
              ctx.fillText(text, x + 15, y + 20);

              return isClicking;
            };

            if (numImages > 1) {
              if (
                drawButton(
                  dw - 40,
                  dh + top - 40,
                  30,
                  `${this.imageIndex + 1}/${numImages}`
                )
              ) {
                let i =
                  this.imageIndex + 1 >= numImages ? 0 : this.imageIndex + 1;
                if (!this.pointerDown || !this.pointerDown.index === i) {
                  this.pointerDown = { index: i, pos: [...mouse] };
                }
              }

              if (drawButton(dw - 40, top + 10, 30, `x`)) {
                if (!this.pointerDown || !this.pointerDown.index === null) {
                  this.pointerDown = { index: null, pos: [...mouse] };
                }
              }
            }
          }
        }
      }
    };
  }

  /**
   * Adds a handler allowing drag+drop of files onto the window to load workflows
   */
  #addDropHandler() {
    // Get prompt from dropped PNG or json
    document.addEventListener("drop", async (event) => {
      event.preventDefault();
      event.stopPropagation();

      const n = this.dragOverNode;
      this.dragOverNode = null;
      // Node handles file drop, we dont use the built in onDropFile handler as its buggy
      // If you drag multiple files it will call it multiple times with the same file
      if (n && n.onDragDrop && (await n.onDragDrop(event))) {
        return;
      }
      // Dragging from Chrome->Firefox there is a file but its a bmp, so ignore that
      if (
        event.dataTransfer.files.length &&
        event.dataTransfer.files[0].type !== "image/bmp"
      ) {
        await this.handleFile(event.dataTransfer.files[0]);
      } else {
        // Try loading the first URI in the transfer list
        const validTypes = ["text/uri-list", "text/x-moz-url"];
        const match = [...event.dataTransfer.types].find((t) =>
          validTypes.find((v) => t === v)
        );
        if (match) {
          const uri = event.dataTransfer.getData(match)?.split("\n")?.[0];
          if (uri) {
            await this.handleFile(await (await fetch(uri)).blob());
          }
        }
      }
    });

    // Always clear over node on drag leave
    this.canvasEl.addEventListener("dragleave", async () => {
      if (this.dragOverNode) {
        this.dragOverNode = null;
        this.graph.setDirtyCanvas(false, true);
      }
    });

    // Add handler for dropping onto a specific node
    this.canvasEl.addEventListener(
      "dragover",
      (e) => {
        this.canvas.adjustMouseEvent(e);
        const node = this.graph.getNodeOnPos(e.canvasX, e.canvasY);
        if (node) {
          if (node.onDragOver && node.onDragOver(e)) {
            this.dragOverNode = node;

            // dragover event is fired very frequently, run this on an animation frame
            requestAnimationFrame(() => {
              this.graph.setDirtyCanvas(false, true);
            });
            return;
          }
        }
        this.dragOverNode = null;
      },
      false
    );
  }

  /**
   * Adds a handler on paste that extracts and loads images or workflows from pasted JSON data
   */
  #addPasteHandler() {
    document.addEventListener("paste", (e) => {
      // ctrl+shift+v is used to paste nodes with connections
      // this is handled by litegraph
      if (this.shiftDown) return;

      let data = e.clipboardData || window.clipboardData;
      const items = data.items;

      // Look for image paste data
      for (const item of items) {
        if (item.type.startsWith("image/")) {
          var imageNode = null;

          // If an image node is selected, paste into it
          if (
            this.canvas.current_node &&
            this.canvas.current_node.is_selected &&
            ComfyApp.isImageNode(this.canvas.current_node)
          ) {
            imageNode = this.canvas.current_node;
          }

          // No image node selected: add a new one
          if (!imageNode) {
            const newNode = LiteGraph.createNode("LoadImage");
            newNode.pos = [...this.canvas.graph_mouse];
            imageNode = this.graph.add(newNode);
            this.graph.change();
          }
          const blob = item.getAsFile();
          imageNode.pasteFile(blob);
          return;
        }
      }

      // No image found. Look for node data
      data = data.getData("text/plain");
      let workflow;
      try {
        data = data.slice(data.indexOf("{"));
        workflow = JSON.parse(data);
      } catch (err) {
        try {
          data = data.slice(data.indexOf("workflow\n"));
          data = data.slice(data.indexOf("{"));
          workflow = JSON.parse(data);
        } catch (error) {}
      }

      if (workflow && workflow.version && workflow.nodes && workflow.extra) {
        this.loadGraphData(workflow);
      } else {
        if (e.target.type === "text" || e.target.type === "textarea") {
          return;
        }

        // Litegraph default paste
        this.canvas.pasteFromClipboard();
      }
    });
  }

  /**
   * Adds a handler on copy that serializes selected nodes to JSON
   */
  #addCopyHandler() {
    document.addEventListener("copy", (e) => {
      if (e.target.type === "text" || e.target.type === "textarea") {
        // Default system copy
        return;
      }

      // copy nodes and clear clipboard
      if (e.target.className === "litegraph" && this.canvas.selected_nodes) {
        this.canvas.copyToClipboard();
        e.clipboardData.setData("text", " "); //clearData doesn't remove images from clipboard
        e.preventDefault();
        e.stopImmediatePropagation();
        return false;
      }
    });
  }

  /**
   * Handle mouse
   *
   * Move group by header
   */
  #addProcessMouseHandler() {
    const self = this;

    const origProcessMouseDown = LGraphCanvas.prototype.processMouseDown;
    LGraphCanvas.prototype.processMouseDown = function (e) {
      const res = origProcessMouseDown.apply(this, arguments);

      this.selected_group_moving = false;

      if (this.selected_group && !this.selected_group_resizing) {
        var font_size =
          this.selected_group.font_size || LiteGraph.DEFAULT_GROUP_FONT_SIZE;
        var height = font_size * 1.4;

        // Move group by header
        if (
          LiteGraph.isInsideRectangle(
            e.canvasX,
            e.canvasY,
            this.selected_group.pos[0],
            this.selected_group.pos[1],
            this.selected_group.size[0],
            height
          )
        ) {
          this.selected_group_moving = true;
        }
      }

      return res;
    };

    const origProcessMouseMove = LGraphCanvas.prototype.processMouseMove;
    LGraphCanvas.prototype.processMouseMove = function (e) {
      const orig_selected_group = this.selected_group;

      if (
        this.selected_group &&
        !this.selected_group_resizing &&
        !this.selected_group_moving
      ) {
        this.selected_group = null;
      }

      const res = origProcessMouseMove.apply(this, arguments);

      if (
        orig_selected_group &&
        !this.selected_group_resizing &&
        !this.selected_group_moving
      ) {
        this.selected_group = orig_selected_group;
      }

      return res;
    };
  }

  /**
   * Handle keypress
   *
   * Ctrl + M mute/unmute selected nodes
   */
  #addProcessKeyHandler() {
    const self = this;
    const origProcessKey = LGraphCanvas.prototype.processKey;
    LGraphCanvas.prototype.processKey = function (e) {
      if (!this.graph) {
        return;
      }

      var block_default = false;

      if (e.target.localName == "input") {
        return;
      }

      if (e.type == "keydown" && !e.repeat) {
        // Ctrl + M mute/unmute
        if (e.key === "m" && e.ctrlKey) {
          if (this.selected_nodes) {
            for (var i in this.selected_nodes) {
              if (this.selected_nodes[i].mode === 2) {
                // never
                this.selected_nodes[i].mode = 0; // always
              } else {
                this.selected_nodes[i].mode = 2; // never
              }
            }
          }
          block_default = true;
        }

        // Ctrl + B bypass
        if (e.key === "b" && e.ctrlKey) {
          if (this.selected_nodes) {
            for (var i in this.selected_nodes) {
              if (this.selected_nodes[i].mode === 4) {
                // never
                this.selected_nodes[i].mode = 0; // always
              } else {
                this.selected_nodes[i].mode = 4; // never
              }
            }
          }
          block_default = true;
        }

        // Alt + C collapse/uncollapse
        if (e.key === "c" && e.altKey) {
          if (this.selected_nodes) {
            for (var i in this.selected_nodes) {
              this.selected_nodes[i].collapse();
            }
          }
          block_default = true;
        }

        // Ctrl+C Copy
        if (e.key === "c" && (e.metaKey || e.ctrlKey)) {
          // Trigger onCopy
          return true;
        }

        // Ctrl+V Paste
        if (
          (e.key === "v" || e.key == "V") &&
          (e.metaKey || e.ctrlKey) &&
          !e.shiftKey
        ) {
          // Trigger onPaste
          return true;
        }
      }

      this.graph.change();

      if (block_default) {
        e.preventDefault();
        e.stopImmediatePropagation();
        return false;
      }

      // Fall through to Litegraph defaults
      return origProcessKey.apply(this, arguments);
    };
  }

  /**
   * Draws group header bar
   */
  #addDrawGroupsHandler() {
    const self = this;

    const origDrawGroups = LGraphCanvas.prototype.drawGroups;
    LGraphCanvas.prototype.drawGroups = function (canvas, ctx) {
      if (!this.graph) {
        return;
      }

      var groups = this.graph._groups;

      ctx.save();
      ctx.globalAlpha = 0.7 * this.editor_alpha;

      for (var i = 0; i < groups.length; ++i) {
        var group = groups[i];

        if (!LiteGraph.overlapBounding(this.visible_area, group._bounding)) {
          continue;
        } //out of the visible area

        ctx.fillStyle = group.color || "#335";
        ctx.strokeStyle = group.color || "#335";
        var pos = group._pos;
        var size = group._size;
        ctx.globalAlpha = 0.25 * this.editor_alpha;
        ctx.beginPath();
        var font_size = group.font_size || LiteGraph.DEFAULT_GROUP_FONT_SIZE;
        ctx.rect(pos[0] + 0.5, pos[1] + 0.5, size[0], font_size * 1.4);
        ctx.fill();
        ctx.globalAlpha = this.editor_alpha;
      }

      ctx.restore();

      const res = origDrawGroups.apply(this, arguments);
      return res;
    };
  }

  /**
   * Draws node highlights (executing, drag drop) and progress bar
   */
  #addDrawNodeHandler() {
    const origDrawNodeShape = LGraphCanvas.prototype.drawNodeShape;
    const self = this;

    LGraphCanvas.prototype.drawNodeShape = function (
      node,
      ctx,
      size,
      fgcolor,
      bgcolor,
      selected,
      mouse_over
    ) {
      const res = origDrawNodeShape.apply(this, arguments);

      const nodeErrors = self.lastNodeErrors?.[node.id];

      let color = null;
      let lineWidth = 1;
      if (node.id === +self.runningNodeId) {
        color = "#0f0";
      } else if (self.dragOverNode && node.id === self.dragOverNode.id) {
        color = "dodgerblue";
      } else if (nodeErrors?.errors) {
        color = "red";
        lineWidth = 2;
      } else if (
        self.lastExecutionError &&
        +self.lastExecutionError.node_id === node.id
      ) {
        color = "#f0f";
        lineWidth = 2;
      }

      if (color) {
        const shape =
          node._shape || node.constructor.shape || LiteGraph.ROUND_SHAPE;
        ctx.lineWidth = lineWidth;
        ctx.globalAlpha = 0.8;
        ctx.beginPath();
        if (shape == LiteGraph.BOX_SHAPE)
          ctx.rect(
            -6,
            -6 - LiteGraph.NODE_TITLE_HEIGHT,
            12 + size[0] + 1,
            12 + size[1] + LiteGraph.NODE_TITLE_HEIGHT
          );
        else if (
          shape == LiteGraph.ROUND_SHAPE ||
          (shape == LiteGraph.CARD_SHAPE && node.flags.collapsed)
        )
          ctx.roundRect(
            -6,
            -6 - LiteGraph.NODE_TITLE_HEIGHT,
            12 + size[0] + 1,
            12 + size[1] + LiteGraph.NODE_TITLE_HEIGHT,
            this.round_radius * 2
          );
        else if (shape == LiteGraph.CARD_SHAPE)
          ctx.roundRect(
            -6,
            -6 - LiteGraph.NODE_TITLE_HEIGHT,
            12 + size[0] + 1,
            12 + size[1] + LiteGraph.NODE_TITLE_HEIGHT,
            [this.round_radius * 2, this.round_radius * 2, 2, 2]
          );
        else if (shape == LiteGraph.CIRCLE_SHAPE)
          ctx.arc(
            size[0] * 0.5,
            size[1] * 0.5,
            size[0] * 0.5 + 6,
            0,
            Math.PI * 2
          );
        ctx.strokeStyle = color;
        ctx.stroke();
        ctx.strokeStyle = fgcolor;
        ctx.globalAlpha = 1;
      }

      if (self.progress && node.id === +self.runningNodeId) {
        ctx.fillStyle = "green";
        ctx.fillRect(
          0,
          0,
          size[0] * (self.progress.value / self.progress.max),
          6
        );
        ctx.fillStyle = bgcolor;
      }

      // Highlight inputs that failed validation
      if (nodeErrors) {
        ctx.lineWidth = 2;
        ctx.strokeStyle = "red";
        for (const error of nodeErrors.errors) {
          if (error.extra_info && error.extra_info.input_name) {
            const inputIndex = node.findInputSlot(error.extra_info.input_name);
            if (inputIndex !== -1) {
              let pos = node.getConnectionPos(true, inputIndex);
              ctx.beginPath();
              ctx.arc(
                pos[0] - node.pos[0],
                pos[1] - node.pos[1],
                12,
                0,
                2 * Math.PI,
                false
              );
              ctx.stroke();
            }
          }
        }
      }

      return res;
    };

    const origDrawNode = LGraphCanvas.prototype.drawNode;
    LGraphCanvas.prototype.drawNode = function (node, ctx) {
      var editor_alpha = this.editor_alpha;
      var old_color = node.bgcolor;

      if (node.mode === 2) {
        // never
        this.editor_alpha = 0.4;
      }

      if (node.mode === 4) {
        // never
        node.bgcolor = "#FF00FF";
        this.editor_alpha = 0.2;
      }

      const res = origDrawNode.apply(this, arguments);

      this.editor_alpha = editor_alpha;
      node.bgcolor = old_color;

      return res;
    };
  }

  /**
   * Handles updates from the API socket
   */
  #addApiUpdateHandlers() {
    api.addEventListener("status", ({ detail }) => {
      this.ui.setStatus(detail);
    });

    api.addEventListener("reconnecting", () => {
      this.ui.dialog.show("Reconnecting...");
    });

    api.addEventListener("reconnected", () => {
      this.ui.dialog.close();
    });

    api.addEventListener("progress", ({ detail }) => {
      this.progress = detail;
      this.graph.setDirtyCanvas(true, false);
    });

    api.addEventListener("executing", ({ detail }) => {
      this.progress = null;
      this.runningNodeId = detail;
      this.graph.setDirtyCanvas(true, false);
      delete this.nodePreviewImages[this.runningNodeId];
    });

    api.addEventListener("executed", ({ detail }) => {
      this.nodeOutputs[detail.node] = detail.output;
      const node = this.graph.getNodeById(detail.node);
      if (node) {
        if (node.onExecuted) node.onExecuted(detail.output);
      }
    });

    api.addEventListener("execution_start", ({ detail }) => {
      this.runningNodeId = null;
      this.lastExecutionError = null;
      this.graph._nodes.forEach((node) => {
        if (node.onExecutionStart) node.onExecutionStart();
      });
    });

    api.addEventListener("execution_error", ({ detail }) => {
      this.lastExecutionError = detail;
      const formattedError = this.#formatExecutionError(detail);
      this.ui.dialog.show(formattedError);
      this.canvas.draw(true, true);
    });

    api.addEventListener("b_preview", ({ detail }) => {
      const id = this.runningNodeId;
      if (id == null) return;

      const blob = detail;
      const blobUrl = URL.createObjectURL(blob);
      this.nodePreviewImages[id] = [blobUrl];
    });

    api.init();
  }

  #addKeyboardHandler() {
    window.addEventListener("keydown", (e) => {
      this.shiftDown = e.shiftKey;
    });
    window.addEventListener("keyup", (e) => {
      this.shiftDown = e.shiftKey;
    });
  }

  #addConfigureHandler() {
    const app = this;
    const configure = LGraph.prototype.configure;
    // Flag that the graph is configuring to prevent nodes from running checks while its still loading
    LGraph.prototype.configure = function () {
      app.configuringGraph = true;
      try {
        return configure.apply(this, arguments);
      } finally {
        app.configuringGraph = false;
      }
    };
  }

  #addAfterConfigureHandler() {
    const app = this;
    const onConfigure = app.graph.onConfigure;
    app.graph.onConfigure = function () {
      // Fire callbacks before the onConfigure, this is used by widget inputs to setup the config
      for (const node of app.graph._nodes) {
        node.onGraphConfigured?.();
      }

      const r = onConfigure?.apply(this, arguments);

      // Fire after onConfigure, used by primitves to generate widget using input nodes config
      for (const node of app.graph._nodes) {
        node.onAfterGraphConfigured?.();
      }

      return r;
    };
  }

