  /**
   * Set up the app on the page
   */
  async setup() {
    // await this.#loadExtensions();

    // Create and mount the LiteGraph in the DOM
    const mainCanvas = document.createElement("canvas");
    mainCanvas.style.touchAction = "none";
    const canvasEl = (this.canvasEl = Object.assign(mainCanvas, {
      id: "graph-canvas",
    }));
    canvasEl.tabIndex = "1";
    // document.body.prepend(canvasEl);
    var comfyCanvas = document.getElementById("comfy-canvas");
    console.log("comfyCanvas", comfyCanvas);
    // if (!comfyCanvas.hasChildNodes()) {
    comfyCanvas.prepend(canvasEl);
    // }

    addDomClippingSetting();
    this.#addProcessMouseHandler();
    this.#addProcessKeyHandler();
    this.#addConfigureHandler();

    this.graph = new LGraph();

    this.#addAfterConfigureHandler();

    const canvas = (this.canvas = new LGraphCanvas(canvasEl, this.graph));
    this.ctx = canvasEl.getContext("2d");

    LiteGraph.release_link_on_empty_shows_menu = true;
    LiteGraph.alt_drag_do_clone_nodes = true;

    this.graph.start();

    function resizeCanvas() {
      // Limit minimal scale to 1, see https://github.com/comfyanonymous/ComfyUI/pull/845
      const scale = Math.max(window.devicePixelRatio, 1);
      const { width, height } = canvasEl.getBoundingClientRect();
      canvasEl.width = Math.round(width * scale);
      canvasEl.height = Math.round(height * scale);
      canvasEl.getContext("2d").scale(scale, scale);
      canvas.draw(true, true);
    }

    // Ensure the canvas fills the window
    resizeCanvas();
    window.addEventListener("resize", resizeCanvas);

    await this.#invokeExtensionsAsync("init");
    await this.registerNodes();

    // Load previous workflow
    let restored = false;
    try {
      const json = localStorage.getItem("workflow");
      if (json) {
        const workflow = JSON.parse(json);
        this.loadGraphData(workflow);
        restored = true;
      }
    } catch (err) {
      console.error("Error loading previous workflow", err);
    }

    // We failed to restore a workflow so load the default
    if (!restored) {
      this.loadGraphData();
    }

    // Save current workflow automatically
    setInterval(
      () =>
        localStorage.setItem(
          "workflow",
          JSON.stringify(this.graph.serialize())
        ),
      1000
    );

    this.#addDrawNodeHandler();
    this.#addDrawGroupsHandler();
    this.#addApiUpdateHandlers();
    this.#addDropHandler();
    this.#addCopyHandler();
    this.#addPasteHandler();
    this.#addKeyboardHandler();

    await this.#invokeExtensionsAsync("setup");
  }

  /**
   * Registers nodes with the graph
   */
  async registerNodes() {
    const app = this;
    // Load node definitions from local json file instead of from the backend
    const defs = nodesDefs;
    await this.registerNodesFromDefs(defs);
    await this.#invokeExtensionsAsync("registerCustomNodes");
  }

  async registerNodesFromDefs(defs) {
    await this.#invokeExtensionsAsync("addCustomNodeDefs", defs);

    // Generate list of known widgets
    const widgets = Object.assign(
      {},
      ComfyWidgets,
      ...(await this.#invokeExtensionsAsync("getCustomWidgets")).filter(Boolean)
    );

    // Register a node for each definition
    for (const nodeId in defs) {
      const nodeData = defs[nodeId];
      const node = Object.assign(
        function ComfyNode() {
          var inputs = nodeData["input"]["required"];
          if (nodeData["input"]["optional"] != undefined) {
            inputs = Object.assign(
              {},
              nodeData["input"]["required"],
              nodeData["input"]["optional"]
            );
          }
          const config = { minWidth: 1, minHeight: 1 };
          for (const inputName in inputs) {
            const inputData = inputs[inputName];
            const type = inputData[0];

            let widgetCreated = true;
            if (Array.isArray(type)) {
              // Enums
              Object.assign(
                config,
                widgets.COMBO(this, inputName, inputData, app) || {}
              );
            } else if (`${type}:${inputName}` in widgets) {
              // Support custom widgets by Type:Name
              Object.assign(
                config,
                widgets[`${type}:${inputName}`](
                  this,
                  inputName,
                  inputData,
                  app
                ) || {}
              );
            } else if (type in widgets) {
              // Standard type widgets
              Object.assign(
                config,
                widgets[type](this, inputName, inputData, app) || {}
              );
            } else {
              // Node connection inputs
              this.addInput(inputName, type);
              widgetCreated = false;
            }

            if (widgetCreated && inputData[1]?.forceInput && config?.widget) {
              if (!config.widget.options) config.widget.options = {};
              config.widget.options.forceInput = inputData[1].forceInput;
            }
            if (widgetCreated && inputData[1]?.defaultInput && config?.widget) {
              if (!config.widget.options) config.widget.options = {};
              config.widget.options.defaultInput = inputData[1].defaultInput;
            }
          }

          for (const o in nodeData["output"]) {
            let output = nodeData["output"][o];
            if (output instanceof Array) output = "COMBO";
            const outputName = nodeData["output_name"][o] || output;
            const outputShape = nodeData["output_is_list"][o]
              ? LiteGraph.GRID_SHAPE
              : LiteGraph.CIRCLE_SHAPE;
            this.addOutput(outputName, output, { shape: outputShape });
          }

          const s = this.computeSize();
          s[0] = Math.max(config.minWidth, s[0] * 1.5);
          s[1] = Math.max(config.minHeight, s[1]);
          this.size = s;
          this.serialize_widgets = true;

          app.#invokeExtensionsAsync("nodeCreated", this);
        },
        {
          title: nodeData.display_name || nodeData.name,
          comfyClass: nodeData.name,
          nodeData,
        }
      );
      node.prototype.comfyClass = nodeData.name;

      this.#addNodeContextMenuHandler(node);
      this.#addDrawBackgroundHandler(node, app);
      this.#addNodeKeyHandler(node);

      await this.#invokeExtensionsAsync(
        "beforeRegisterNodeDef",
        node,
        nodeData
      );
      LiteGraph.registerNodeType(nodeId, node);
      node.category = nodeData.category;
    }
  }

  loadTemplateData(templateData) {
    if (!templateData?.templates) {
      return;
    }

    const old = localStorage.getItem("litegrapheditor_clipboard");

    var maxY, nodeBottom, node;

    for (const template of templateData.templates) {
      if (!template?.data) {
        continue;
      }

      localStorage.setItem("litegrapheditor_clipboard", template.data);
      app.canvas.pasteFromClipboard();

      // Move mouse position down to paste the next template below

      maxY = false;

      for (const i in app.canvas.selected_nodes) {
        node = app.canvas.selected_nodes[i];

        nodeBottom = node.pos[1] + node.size[1];

        if (maxY === false || nodeBottom > maxY) {
          maxY = nodeBottom;
        }
      }

      app.canvas.graph_mouse[1] = maxY + 50;
    }

    localStorage.setItem("litegrapheditor_clipboard", old);
  }

  showMissingNodesError(missingNodeTypes, hasAddedNodes = true) {
    this.ui.dialog.show(
      `When loading the graph, the following node types were not found: <ul>${Array.from(
        new Set(missingNodeTypes)
      )
        .map((t) => `<li>${t}</li>`)
        .join("")}</ul>${
        hasAddedNodes
          ? "Nodes that have failed to load will show as red on the graph."
          : ""
      }`
    );
    this.logging.addEntry("Comfy.App", "warn", {
      MissingNodes: missingNodeTypes,
    });
  }

  /**
   * Populates the graph with the specified workflow data
   * @param {*} graphData A serialized graph object
   */
  loadGraphData(graphData) {
    this.clean();

    let reset_invalid_values = false;
    if (!graphData) {
      graphData = defaultGraph;
      reset_invalid_values = true;
    }

    if (typeof structuredClone === "undefined") {
      graphData = JSON.parse(JSON.stringify(graphData));
    } else {
      graphData = structuredClone(graphData);
    }

    const missingNodeTypes = [];
    for (let n of graphData.nodes) {
      // Patch T2IAdapterLoader to ControlNetLoader since they are the same node now
      if (n.type == "T2IAdapterLoader") n.type = "ControlNetLoader";
      if (n.type == "ConditioningAverage ") n.type = "ConditioningAverage"; //typo fix
      if (n.type == "SDV_img2vid_Conditioning")
        n.type = "SVD_img2vid_Conditioning"; //typo fix

      // Find missing node types
      if (!(n.type in LiteGraph.registered_node_types)) {
        n.type = sanitizeNodeName(n.type);
        missingNodeTypes.push(n.type);
      }
    }

    try {
      this.graph.configure(graphData);
    } catch (error) {
      let errorHint = [];
      // Try extracting filename to see if it was caused by an extension script
      const filename =
        error.fileName ||
        (error.stack || "").match(/(\/extensions\/.*\.js)/)?.[1];
      const pos = (filename || "").indexOf("/extensions/");
      if (pos > -1) {
        errorHint.push(
          $el("span", {
            textContent: "This may be due to the following script:",
          }),
          $el("br"),
          $el("span", {
            style: {
              fontWeight: "bold",
            },
            textContent: filename.substring(pos),
          })
        );
      }

      // Show dialog to let the user know something went wrong loading the data
      this.ui.dialog.show(
        $el("div", [
          $el("p", {
            textContent: "Loading aborted due to error reloading workflow data",
          }),
          $el("pre", {
            style: { padding: "5px", backgroundColor: "rgba(255,0,0,0.2)" },
            textContent: error.toString(),
          }),
          $el("pre", {
            style: {
              padding: "5px",
              color: "#ccc",
              fontSize: "10px",
              maxHeight: "50vh",
              overflow: "auto",
              backgroundColor: "rgba(0,0,0,0.2)",
            },
            textContent: error.stack || "No stacktrace available",
          }),
          ...errorHint,
        ]).outerHTML
      );

      return;
    }

    for (const node of this.graph._nodes) {
      const size = node.computeSize();
      size[0] = Math.max(node.size[0], size[0]);
      size[1] = Math.max(node.size[1], size[1]);
      node.size = size;

      if (node.widgets) {
        // If you break something in the backend and want to patch workflows in the frontend
        // This is the place to do this
        for (let widget of node.widgets) {
          if (node.type == "KSampler" || node.type == "KSamplerAdvanced") {
            if (widget.name == "sampler_name") {
              if (widget.value.startsWith("sample_")) {
                widget.value = widget.value.slice(7);
              }
            }
          }
          if (
            node.type == "KSampler" ||
            node.type == "KSamplerAdvanced" ||
            node.type == "PrimitiveNode"
          ) {
            if (widget.name == "control_after_generate") {
              if (widget.value === true) {
                widget.value = "randomize";
              } else if (widget.value === false) {
                widget.value = "fixed";
              }
            }
          }
          if (reset_invalid_values) {
            if (widget.type == "combo") {
              if (
                !widget.options.values.includes(widget.value) &&
                widget.options.values.length > 0
              ) {
                widget.value = widget.options.values[0];
              }
            }
          }
        }
      }

      this.#invokeExtensions("loadedGraphNode", node);
    }

    if (missingNodeTypes.length) {
      this.showMissingNodesError(missingNodeTypes);
    }
  }

  /**
   * Converts the current graph workflow for sending to the API
   * @returns The workflow and node links
   */
  async graphToPrompt() {
    for (const node of this.graph.computeExecutionOrder(false)) {
      if (node.isVirtualNode) {
        // Don't serialize frontend only nodes but let them make changes
        if (node.applyToGraph) {
          node.applyToGraph();
        }
        continue;
      }
    }

    const workflow = this.graph.serialize();
    const output = {};
    // Process nodes in order of execution
    for (const node of this.graph.computeExecutionOrder(false)) {
      const n = workflow.nodes.find((n) => n.id === node.id);

      if (node.isVirtualNode) {
        continue;
      }

      if (node.mode === 2 || node.mode === 4) {
        // Don't serialize muted nodes
        continue;
      }

      const inputs = {};
      const widgets = node.widgets;

      // Store all widget values
      if (widgets) {
        for (const i in widgets) {
          const widget = widgets[i];
          if (!widget.options || widget.options.serialize !== false) {
            inputs[widget.name] = widget.serializeValue
              ? await widget.serializeValue(n, i)
              : widget.value;
          }
        }
      }

      // Store all node links
      for (let i in node.inputs) {
        let parent = node.getInputNode(i);
        if (parent) {
          let link = node.getInputLink(i);
          while (parent.mode === 4 || parent.isVirtualNode) {
            let found = false;
            if (parent.isVirtualNode) {
              link = parent.getInputLink(link.origin_slot);
              if (link) {
                parent = parent.getInputNode(link.target_slot);
                if (parent) {
                  found = true;
                }
              }
            } else if (link && parent.mode === 4) {
              let all_inputs = [link.origin_slot];
              if (parent.inputs) {
                all_inputs = all_inputs.concat(Object.keys(parent.inputs));
                for (let parent_input in all_inputs) {
                  parent_input = all_inputs[parent_input];
                  if (
                    parent.inputs[parent_input]?.type === node.inputs[i].type
                  ) {
                    link = parent.getInputLink(parent_input);
                    if (link) {
                      parent = parent.getInputNode(parent_input);
                    }
                    found = true;
                    break;
                  }
                }
              }
            }

            if (!found) {
              break;
            }
          }

          if (link) {
            inputs[node.inputs[i].name] = [
              String(link.origin_id),
              parseInt(link.origin_slot),
            ];
          }
        }
      }

      output[String(node.id)] = {
        inputs,
        class_type: node.comfyClass,
      };
    }

    // Remove inputs connected to removed nodes

    for (const o in output) {
      for (const i in output[o].inputs) {
        if (
          Array.isArray(output[o].inputs[i]) &&
          output[o].inputs[i].length === 2 &&
          !output[output[o].inputs[i][0]]
        ) {
          delete output[o].inputs[i];
        }
      }
    }

    return { workflow, output };
  }

  #formatPromptError(error) {
    if (error == null) {
      return "(unknown error)";
    } else if (typeof error === "string") {
      return error;
    } else if (error.stack && error.message) {
      return error.toString();
    } else if (error.response) {
      let message = error.response.error.message;
      if (error.response.error.details)
        message += ": " + error.response.error.details;
      for (const [nodeID, nodeError] of Object.entries(
        error.response.node_errors
      )) {
        message += "\n" + nodeError.class_type + ":";
        for (const errorReason of nodeError.errors) {
          message +=
            "\n    - " + errorReason.message + ": " + errorReason.details;
        }
      }
      return message;
    }
    return "(unknown error)";
  }

  #formatExecutionError(error) {
    if (error == null) {
      return "(unknown error)";
    }

    const traceback = error.traceback.join("");
    const nodeId = error.node_id;
    const nodeType = error.node_type;

    return `Error occurred when executing ${nodeType}:\n\n${error.exception_message}\n\n${traceback}`;
  }

  async queuePrompt(number, batchCount = 1) {
    this.#queueItems.push({ number, batchCount });

    // Only have one action process the items so each one gets a unique seed correctly
    if (this.#processingQueue) {
      return;
    }

    this.#processingQueue = true;
    this.lastNodeErrors = null;

    try {
      while (this.#queueItems.length) {
        ({ number, batchCount } = this.#queueItems.pop());

        for (let i = 0; i < batchCount; i++) {
          const p = await this.graphToPrompt();

          try {
            const res = await api.queuePrompt(number, p);
            this.lastNodeErrors = res.node_errors;
            if (this.lastNodeErrors.length > 0) {
              this.canvas.draw(true, true);
            }
          } catch (error) {
            const formattedError = this.#formatPromptError(error);
            this.ui.dialog.show(formattedError);
            if (error.response) {
              this.lastNodeErrors = error.response.node_errors;
              this.canvas.draw(true, true);
            }
            break;
          }

          for (const n of p.workflow.nodes) {
            const node = graph.getNodeById(n.id);
            if (node.widgets) {
              for (const widget of node.widgets) {
                // Allow widgets to run callbacks after a prompt has been queued
                // e.g. random seed after every gen
                if (widget.afterQueued) {
                  widget.afterQueued();
                }
              }
            }
          }

          this.canvas.draw(true, true);
          await this.ui.queue.update();
        }
      }
    } finally {
      this.#processingQueue = false;
    }
  }

  /**
   * Loads workflow data from the specified file
   * @param {File} file
   */
  async handleFile(file) {
    if (file.type === "image/png") {
      const pngInfo = await getPngMetadata(file);
      if (pngInfo) {
        if (pngInfo.workflow) {
          this.loadGraphData(JSON.parse(pngInfo.workflow));
        } else if (pngInfo.parameters) {
          importA1111(this.graph, pngInfo.parameters);
        }
      }
    } else if (file.type === "image/webp") {
      const pngInfo = await getWebpMetadata(file);
      if (pngInfo) {
        if (pngInfo.workflow) {
          this.loadGraphData(JSON.parse(pngInfo.workflow));
        } else if (pngInfo.Workflow) {
          this.loadGraphData(JSON.parse(pngInfo.Workflow)); // Support loading workflows from that webp custom node.
        }
      }
    } else if (
      file.type === "application/json" ||
      file.name?.endsWith(".json")
    ) {
      const reader = new FileReader();
      reader.onload = () => {
        const jsonContent = JSON.parse(reader.result);
        if (jsonContent?.templates) {
          this.loadTemplateData(jsonContent);
        } else if (this.isApiJson(jsonContent)) {
          this.loadApiJson(jsonContent);
        } else {
          this.loadGraphData(jsonContent);
        }
      };
      reader.readAsText(file);
    } else if (
      file.name?.endsWith(".latent") ||
      file.name?.endsWith(".safetensors")
    ) {
      const info = await getLatentMetadata(file);
      if (info.workflow) {
        this.loadGraphData(JSON.parse(info.workflow));
      }
    }
  }

  isApiJson(data) {
    return Object.values(data).every((v) => v.class_type);
  }

  loadApiJson(apiData) {
    const missingNodeTypes = Object.values(apiData).filter(
      (n) => !LiteGraph.registered_node_types[n.class_type]
    );
    if (missingNodeTypes.length) {
      this.showMissingNodesError(
        missingNodeTypes.map((t) => t.class_type),
        false
      );
      return;
    }

    const ids = Object.keys(apiData);
    app.graph.clear();
    for (const id of ids) {
      const data = apiData[id];
      const node = LiteGraph.createNode(data.class_type);
      node.id = isNaN(+id) ? id : +id;
      graph.add(node);
    }

    for (const id of ids) {
      const data = apiData[id];
      const node = app.graph.getNodeById(id);
      for (const input in data.inputs ?? {}) {
        const value = data.inputs[input];
        if (value instanceof Array) {
          const [fromId, fromSlot] = value;
          const fromNode = app.graph.getNodeById(fromId);
          const toSlot = node.inputs?.findIndex((inp) => inp.name === input);
          if (toSlot !== -1) {
            fromNode.connect(fromSlot, node, toSlot);
          }
        } else {
          const widget = node.widgets?.find((w) => w.name === input);
          if (widget) {
            widget.value = value;
            widget.callback?.(value);
          }
        }
      }
    }

    app.graph.arrange();
  }

  /**
   * Registers a Comfy web extension with the app
   * @param {ComfyExtension} extension
   */
  registerExtension(extension) {
    if (!extension.name) {
      throw new Error("Extensions must have a 'name' property.");
    }
    if (this.extensions.find((ext) => ext.name === extension.name)) {
      throw new Error(
        `Extension named '${extension.name}' already registered.`
      );
    }
    this.extensions.push(extension);
  }

  /**
   * Refresh combo list on whole nodes
   */
  async refreshComboInNodes() {
    const defs = await api.getNodeDefs();

    for (const nodeId in LiteGraph.registered_node_types) {
      const node = LiteGraph.registered_node_types[nodeId];
      const nodeDef = defs[nodeId];
      if (!nodeDef) continue;

      node.nodeData = nodeDef;
    }

    for (let nodeNum in this.graph._nodes) {
      const node = this.graph._nodes[nodeNum];
      const def = defs[node.type];

      // Allow primitive nodes to handle refresh
      node.refreshComboInNode?.(defs);

      if (!def) continue;

      for (const widgetNum in node.widgets) {
        const widget = node.widgets[widgetNum];
        if (
          widget.type == "combo" &&
          def["input"]["required"][widget.name] !== undefined
        ) {
          widget.options.values = def["input"]["required"][widget.name][0];

          if (
            widget.name != "image" &&
            !widget.options.values.includes(widget.value)
          ) {
            widget.value = widget.options.values[0];
            widget.callback(widget.value);
          }
        }
      }
    }
  }

  /**
   * Clean current state
   */
  clean() {
    this.nodeOutputs = {};
    this.nodePreviewImages = {};
    this.lastNodeErrors = null;
    this.lastExecutionError = null;
    this.runningNodeId = null;
  }
}

export const app = new ComfyApp();
